/******************************************************************************
 *                                 Linked List
 ******************************************************************************/

 /**
  * Represents a node within a linked list
  *
  * @param data The data held by this node
  * @param next The next node within this list. Is NULL when this is tail
  * 					of the list
  */
struct Node {
	void* data;
	struct Node* next;
};

/**
 * Generates a node for a linked list
 *
 * @param data The data
 * @param dataSize The size of the data. This is found using:
 * 						sizeof( *INSERT TYPE HERE* )
 * 					For example, if the data's type is an integer,
 * 						sizeof( int )
 * @return The generated node
 */
struct Node* generateNode( void* data, size_t dataSize ) {
	// allocating memory for the generated node
	struct Node* toReturn = ( struct Node* ) malloc( sizeof( struct Node ) );
	// allocating memory for the data
	toReturn->data = malloc( dataSize );
	// copying the provided data into this node's data
	memcpy( toReturn->data, data, dataSize );
	// setting the next pointer to null
	toReturn->next = NULL;
	return toReturn;
}

/**
 * Adds the provided node to the end of the list
 *
 * @param list The list
 * @param node The node to add
 */
void addNode( struct Node** list, struct Node* node ) {
	// If the list is empty, then we set its first node as the 
	//		provided node
	if ( *list == NULL ) {
		*list = node;
	}
	else {
		// Finding the last node of the list
		struct Node* temp = *list;
		while ( temp->next != NULL ) {
			temp = temp->next;
		}

		// Setting the last node's next to the provided node
		temp->next = node;
	}
}

/**
 * Addes the provided data to the end of the list
 *
 * @param list The list
 * @param data The data to add
 * @param dataSize The size of the data's type (see comments of
 * 						the generateNode() function for information
 * 						on what this means)
 */
void addNodeFromData( struct Node** list, void* data, size_t dataSize ) {
	struct Node* dataNode = generateNode( data, dataSize );
	addNode( list, dataNode );
}

/**
 * Checks if the list contains the provided node
 *
 * @param list The list to search
 * @param node The node to look for
 * @return true if the node is within the list
 * @return false if the node is not within the list
 */
bool containsNode( struct Node** list, struct Node* node ) {
	if ( *list == NULL ) return false;

	struct Node* current = *list;
	while ( current != NULL ) {
		if ( current == node ) return true;
		current = current->next;
	}
	return false;
}

/**
 * Attempts to locate the node that contains the provided data
 *
 * @param list The list to search through
 * @param data The data to look for
 * @return the node, if it was found. Returns NULL if it wasn't found
 */
struct Node* searchForData( struct Node** list, void* data ) {
	if ( *list == NULL ) return NULL;

	struct Node* current = *list;
	while ( current != NULL ) {
		if ( current->data == data ) return current;
		current = current->next;
	}
	return NULL;
}

/**
 * Attempts to locate the node that matches the provided function
 *
 * @param list The list to search through
 * @param func The function to evaluate against
 * @return the node, if it was found. Returns NULL if it wasn't found
 */
struct Node* searchByLambda( struct Node** list, bool ( *func )( struct Node* ) ) {
	if ( *list == NULL ) return NULL;

	struct Node* current = *list;
	while ( current != NULL ) {
		if ( ( *func )( current ) ) return current;
		current = current->next;
	}
	return NULL;
}

/**
 * Removes the provided node from the list
 * Also frees the node from memory as well
 *
 * @param list The list
 * @param node The node to remove
 * @return true if the node was successfully removed, false otherwise
 */
bool removeNode( struct Node** list, struct Node* node ) {
	// if the list is empty, return false
	if ( *list == NULL ) return false;

	// Finding the node within the list whose next value
	//		equals the given node
	struct Node* temp = *list;
	while ( temp->next != node && temp->next != NULL ) {
		temp = temp->next;
	}

	// if temp->next is nothing, return false
	if ( temp->next == NULL ) return false;

	// removing the node from the list by setting the
	//		temp node's next to the next of the given node
	temp->next = node->next;

	free( node );
	return true;
}

/**
 * Removes the provided node from the list, but does NOT free it
 * 		from memory
 *
 * @param list The list to remove the node from
 * @param node The node to remove
 * @return true if the node was removed successfully
 * @return false if the node was not removed successfully
 */
bool removeNodeWithoutDeletion( struct Node** list, struct Node* node ) {
	// if the list is empty, return false
	if ( *list == NULL ) return false;

	// Finding the node within the list whose next value
	//		equals the given node
	struct Node* temp = *list;
	while ( temp->next != node && temp->next != NULL ) {
		temp = temp->next;
	}

	// if temp->next is nothing, return false
	if ( temp->next == NULL ) return false;

	// removing the node from the list by setting the
	//		temp node's next to the next of the given node
	temp->next = node->next;
	return true;
}

/**
 * Clears the provided list of all its contents
 *
 * @param list The list to clear
 */
void clearList( struct Node** list ) {
	// if the list is empty, do nothing
	if ( *list == NULL ) return;

	struct Node* node = *list;
	while ( node != NULL ) {
		struct Node* temp = node;
		node = node->next;
		free( temp->data );
		free( temp );
	}

	*list = NULL;
}

/**
 * Returns the size of the provided list
 *
 * @param list The list
 * @return the size of the list
 */
int getListSize( struct Node** list ) {
	if ( *list == NULL ) return 0;
	struct Node* node = *list;
	int toReturn = 0;
	while ( node != NULL ) {
		toReturn++;
		node = node->next;
	}
	return toReturn;
}

