/**
 * A custom function gate, which can be created and saved by the user
 * Basic idea of saving the user's custom gate:
 * 		- Simulate all possible inputs to the schematic the user wants
 * 				to save as a custom gate
 * 		- For each possible input, save the outputs of the schematic
 * 				to a list
 * When the user uses this custom gate, we will determine the output(s)
 * 		of this gate by setting it equal to the output that corresponds
 * 		to this gate's current inputs, as dictated by the saved list of
 * 		inputs and outputs (see above)
 *
 * @param id The debug ID of this gate
 * @param position The top-left corner of this gate's position
 * @param inputs The inputs (min = 1, max = GATE_MAX_ARGS) that connect
 * 					to the input(s) of this gate
 * @param outputs The outputs (min = 1, max = GATE_MAX_ARGS) that
 * 					connect to the output(s) of this gate
 * @param name The name of this gate. Should only be 1 character long
 * @param truth_table The truth table of *outputs* that this gate can
 * 					produce. Some notes about this variable:
 * 						- The first index corresponds to which set of
 * 							inputs (from the POTENTIAL_INPUTS list)
 * 							this set of outputs is for
 * 						- The second index corresponds to each output,
 * 							with output #1 being at index 0, output #2
 * 							at index 1, etc.
 * 						- If GATE_MAX_ARGS changes, then the size of
 * 							this variable will need to be updated
 */
struct Custom_Gate {
	int id;
	struct Position position;
	struct Node* inputs_id; // TODO (?) change inputs to be an int list (input wires' IDs)
	struct Node* outputs_id; // TODO (?) change outputs to be an int list (output wires' IDs)
	char name;
	int truth_table[8][3];
};
