/**
 * Plots a pixel at the given position
 *
 * @param x The x coordinate to draw at
 * @param y The y coordinate to draw at
 * @param color The color to draw
 */
void plot_pixel( int x, int y, short int color ) {
	volatile short int* one_pixel_address;
	one_pixel_address = pixel_buffer_start + ( y << 10 ) + ( x << 1 );
	*one_pixel_address = color;
}

/**
 * Swaps the two provided variables
 *
 * @param a Input 1
 * @param b Input 2
 */
void swap( int* a, int* b ) {
	int temp = *a;
	*a = *b;
	*b = temp;
}

/**
 * Calculates the distance squared between two
 *		positions
 *
 * @param pos1 The first position
 * @param pos2 The second position
 * @return The distance between the two positions
 */
double calculateDistanceSquared( struct Position pos1, struct Position pos2 ) {
	double deltaX = pos1.x - pos2.x;
	double deltaY = pos1.y - pos2.y;
	return ( deltaX * deltaX ) + ( deltaY * deltaY );
}

/**
 * Draws the provided wire on the screen
 *
 * @param wire The wire to draw on the screen
 */
void draw_wire( struct Wire wire ) {
	int x0 = wire.startPos.x;
	int y0 = wire.startPos.y;
	int x1 = wire.endPos.x;
	int y1 = wire.endPos.y;
	enum Colors wire_color = ( wire.state == true ) ? ( WIRE_ON_COLOR ) : ( WIRE_OFF_COLOR );
	bool isSteep = abs( y1 - y0 ) > abs( x1 - x0 );

	if ( isSteep ) {
		swap( &x0, &y0 );
		swap( &x1, &y1 );
	}

	if ( x0 > x1 ) {
		swap( &x0, &x1 );
		swap( &y0, &y1 );
	}



	int deltaX = ( x1 - x0 );
	int deltaY = abs( y1 - y0 );
	int error = -( deltaX / 2 );
	int y = y0;
	int y_step;

	if ( y0 < y1 ) {
		y_step = 1;
	}
	else {
		y_step = -1;
	}

	for ( int i = x0; i <= x1; i++ ) {
		if ( isSteep ) {
			plot_pixel( y, i, wire_color );
			plot_pixel( y, i + 1, wire_color );
			background[i * 320 + y] = wire_color;
			background[( i + 1 ) * 320 + ( y )] = wire_color;
		}
		else {
			plot_pixel( i, y, wire_color );
			plot_pixel( i + 1, y, wire_color );
			background[y * 320 + i] = wire_color;
			background[( y ) * 320 + i + 1] = wire_color;
		}
		error = error + deltaY;
		if ( error > 0 ) {
			y = y + y_step;
			error = error - deltaX;
		}

	}


}

