/**
 * Waits for the next vsync to happen
 */
void wait_for_vsync() {
	volatile int* fbuf = ( int* ) 0xFF203020;
	int status;
	*fbuf = 1; // Start vsync cycle

	status = *( fbuf + 3 ); //Read status register

	while ( ( status & 0x1 ) != 0 ) {
		status = *( fbuf + 3 ); //Polling loop waiting for s bit = 0
	}
	return;
}




/**
 * Updates all elements within the simulation
 */
void updateEverything() {

	// Regenerating the connected wires
	regenerateConnectedWires();

	// Updating all wire groups
	// 		this, in turn, updates all gates and circuit outputs
	updateAllWireGroups();
}

/**
 * Regenerates all the connected wires in the WIRE_GROUP_LIST
 */
void regenerateConnectedWires() {
	// Clearing the connected wire list
	if ( WIRE_GROUP_LIST != NULL ) {
		clearList( &WIRE_GROUP_LIST );
	}

	// Iterating over all the wires
	struct Node* currentNode = WIRE_LIST;
	while ( currentNode != NULL ) {
		// getting the currentNode's wire data
		struct Wire currentWire = *( ( struct Wire* ) currentNode->data );

		// If the current wire is found/set to be in a group, set 
		//		this to true
		bool currentWireInGroup = false;
		// Iterating over all the wires that are not the current wire
		struct Node* otherNode = WIRE_LIST;
		while ( otherNode != NULL ) {
			// getting the otherNode's wire data
			struct Wire otherWire = *( ( struct Wire* ) otherNode->data );

			// we only want to iterate over wires that are not 
			//		the current wire
			if ( currentWire.id == otherWire.id ) {
				otherNode = otherNode->next;
				continue;
			}

			// checking if the wires connect with each other at either 
			//		of their start or end points
			double bufferRangeSquared = WIRE_CONNECTION_BUFFER_RANGE * WIRE_CONNECTION_BUFFER_RANGE;
			bool wiresConnect =
				// current wire start position ~= other wire start position
				( calculateDistanceSquared( currentWire.startPos, otherWire.startPos ) <= bufferRangeSquared )
				// current wire start position ~= other wire end position
				|| ( calculateDistanceSquared( currentWire.startPos, otherWire.endPos ) <= bufferRangeSquared )
				// current wire end position ~= other wire start position
				|| ( calculateDistanceSquared( currentWire.endPos, otherWire.startPos ) <= bufferRangeSquared )
				// current wire end position ~= other wire end position
				|| ( calculateDistanceSquared( currentWire.endPos, otherWire.endPos ) <= bufferRangeSquared );

			// if either of the two endpoints of the other wire are at
			//		any of the coordinates of the current wire, then
			//		they both belong to the same connected wire set
			if ( wiresConnect ) {
				// the wire will now be added to a group, so we can say
				//		it has a group 
				currentWireInGroup = true;

				// getting the connected wire list the current wire and 
				//		the other wire are grouped with, if any
				_lambda_arg_wire = *( ( struct Wire* ) currentNode->data );
				struct Node* currentGroup = searchByLambda( &WIRE_GROUP_LIST, _lambda_fxn_getWireGroupContainingWire );
				
				_lambda_arg_wire = *( ( struct Wire* ) otherNode->data );
				struct Node* otherGroup = searchByLambda( &WIRE_GROUP_LIST, _lambda_fxn_getWireGroupContainingWire );

				// if current wire is in a connected wire list but the 
				//		other wire is not, then we add the other wire
				//		to the current wire's list
				if ( currentGroup != NULL && otherGroup == NULL ) {
					struct Wire_Group group = *( ( struct Wire_Group* ) currentGroup->data );
					addNodeFromData( &group.wires_id, &otherWire.id, sizeof( int ) );
				}

				// if current wire is not in a connected wire list but 
				//		the other wire is, then we add the current wire
				//		to the other wire's list
				else if ( currentGroup == NULL && otherGroup != NULL ) {
					struct Wire_Group group = *( ( struct Wire_Group* ) otherGroup->data );
					addNodeFromData( &group.wires_id, &currentWire.id, sizeof( int ) );
				}

				// if the current wire and the other wire are both in a 
				//		group, then we combine the other wire's group
				//		into the current wire's group
				else if ( currentGroup != NULL && otherGroup != NULL ) {
					struct Wire_Group group = *( ( struct Wire_Group* ) currentGroup->data );
					struct Wire_Group addingGroup = *( ( struct Wire_Group* ) otherGroup->data );

					// if the two groups are the same, then we don't 
					//		need to do anything more
					if ( group.id == addingGroup.id ) { break; }

					struct Node* n = addingGroup.wires_id;
					while ( n != NULL ) {
						struct Node* next = n->next;
						n->next = NULL;
						addNode( &group.wires_id, n );
						n = next;
					}

					// removing the other group from the wire group list
					removeNode( &WIRE_GROUP_LIST, otherGroup );
					// freeing the otherGroup's wire list
					clearList( &addingGroup.wires_id );
					//clearList( &otherGroup->data );
					// freeing otherGroup
					free( otherGroup );
				}

				// otherwise, both the current wire and the other wire 
				//		are not in a group, so we create a new group
				//		for them
				else {
					// Creating the group
					struct Wire_Group group = MACRO_NULL_WIRE_GROUP;
					group.id = generateDebugId();
					addNodeFromData( &group.wires_id, &currentWire.id, sizeof( int ) );
					addNodeFromData( &group.wires_id, &otherWire.id, sizeof( int ) );

					// Adding the group to the list of groups
					addNodeFromData( &WIRE_GROUP_LIST, &group, sizeof( struct Wire_Group ) );
				}
			}

			otherNode = otherNode->next;
		}

		// if the current wire was not set/found in a group, then 
		//		we create a group for it
		if ( currentWireInGroup == false ) {
			struct Wire_Group group = MACRO_NULL_WIRE_GROUP;
			group.id = generateDebugId();
			addNodeFromData( &group.wires_id, &currentWire.id, sizeof( int ) );

			// Adding the group to the list of groups
			addNodeFromData( &WIRE_GROUP_LIST, &group, sizeof( struct Wire_Group ) );
		}

		currentNode = currentNode->next;
	}

	return;
}

/**
 * Gets the wire group that contains the provided wire
 *
 * @param wire the wire to search by
 * @return the node form of the wire group that contains the wire
 */
struct Node* getWireGroupContainingWire( struct Wire wire ) {
	_lambda_arg_wire = wire;
	return searchByLambda( &WIRE_GROUP_LIST, _lambda_fxn_getWireGroupContainingWire );
}

/**
 * Updates the output of the NAND gate
 *
 * @param gate The NAND gate to update
 */
void updateNandGate( struct Nand_Gate* gate ) {
	// if there are no outputs connected to the NAND gate, then we
	//		don't need to do anything
	if ( gate->output_id == NULL_DEBUG_ID ) { return; }
	// getting the output wire
	struct Wire* outputWire = getWireFromId( gate->output_id );

	// if there are no inputs connected to the NAND gate, then its
	//		output must be zero and we don't need to do anything else
	if ( gate->inputs_id == NULL ) {
		outputWire->state = false;
		return;
	}

	// there is a maximum of two inputs per each NAND gate
	// attempting to get the two inputs connected to the NAND gate
	struct Node* wire1Node = gate->inputs_id;
	struct Node* wire2Node = wire1Node->next;

	struct Wire wire1 = *getWireFromId( *( ( int* ) wire1Node->data ) );
	struct Wire wire2 = MACRO_NULL_WIRE;

	// if wire2Node is null, then there is only one input
	// if this is the case, then we treat the second input as if it
	//		is always zero
	if ( wire2Node == NULL ) {
		wire2.state = 0;
	}

	// otherwise, we get wire 2 from its node
	else { wire2 = *getWireFromId( *( ( int* ) wire2Node->data ) ); }

	// searching for the index of the POTENTIAL_INPUTS list that
	//		corresponds to the NAND gate's current set of inputs
	// since the POTENTIAL_INPUTS list has 3 inputs but a NAND gate
	//		only has 2, we ignore the third column of that list
	int index = -1;
	for ( int i = 0; i < 8; i++ ) {
		if ( POTENTIAL_INPUTS[i][0] == wire1.state && POTENTIAL_INPUTS[i][1] == wire2.state ) {
			index = i;
			break;
		}
	}

	// getting the output that corresponds to the index found via the 
	//		NAND_GATE_OUTPUTS list
	outputWire->state = NAND_GATE_OUTPUTS[index];
	forceUpdateWireGroupStateFromWire( *outputWire );
}

