/**
 * Updates the state of all wire groups
 * Also updates the state of all gates and circuit outputs
 *
 * Algorithm:
 * let {updatedGroups} be a list of groups that have already been updated
 * let {groupsToUpdate} be a list of groups that we will update on the next wire update cycle
 * let {gatesToUpdate} be a list of gates that we will update on the next gate update cycle
 * //let {remainingGroups} be a list of groups that still have yet to be updated and are not in {groupsToUpdate}
 * //add all circuit groups to {remainingGroups}
 *
 * let {circuitInputs} be a list of the circuit inputs
 * let {_circuitInputWires} be all the wires connected to the circuit inputs
 * for each {_inputWire} in {_circuitInputWires}:
 * 		add {_inputWire}'s wire group to {groupsToUpdate}
 * 		//remove {_inputWire}'s wire group from {remainingGroups}
 *
 * * WIRE UPDATE CYCLE
 * while {groupsToUpdate}'s size is not zero:
 * 		let {_group} be the first group in {groupsToUpdate}
 * 		remove {_group} from {groupsToUpdate}
 * 		update {_group}'s state to the output of the previous gate // a previous gate can be a circuit input, nand gate, or custom gate
 * 		for every wire {_wire} in {_group}:
 * 			update {_wire}'s state to the output of the previous gate
 *
 * 		set {_connectedGates} to all gates {_group} is connected to as the input
 * 		add all {_connectedGates} to {gatesToUpdate}
 *
 * 		if {groupsToUpdate}'s size is zero:
 * 			* GATE UPDATE CYCLE
 * 			while {gatesToUpdate}'s size is not zero:
 * 				let {_gate} be the first group in {gatesToUpdate}
 * 				remove {_gate} from {gatesToUpdate}
 * 				update {_gate}'s outputs
 * 				let {_gateOutputs} be the wire groups that connect to {_gate}'s outputs
 * 				for every wire group {_g} in {_gateOutputs}:
 * 					if {_g} is not in {updatedGroups}:
 * 						add {_g} to {groupsToUpdate}
 *
 *
 * ! I don't believe this algorithm will work for circuits that have
 * 		! outputs that connect back to their own input, but we will
 * 		! figure that out later
 */
void updateAllWireGroups() {
	
	struct Node* updatedGroups = NULL;
	struct Node* groupsToUpdate = NULL;

	struct Node* circuitInputNode = CIRCUIT_INPUT_LIST;
	while ( circuitInputNode != NULL ) {
		struct Circuit_Input input = *( ( struct Circuit_Input* ) circuitInputNode->data );
		struct Wire* wire = getWireFromId( input.connectingWire_id );
		if ( wire != NULL ) {
			// updating the wire's state to the circuit input's state
			wire->state = input.state;

			// searching for the wire's group
			_lambda_arg_wire = *wire;
			struct Node* wireGroup = searchByLambda( &WIRE_GROUP_LIST, _lambda_fxn_getWireGroupContainingWire );
			if ( wireGroup != NULL ) {
				// * note: we cannot add the node since it's next value 
				// *		is critical for the CIRCUIT_INPUT_LIST
				// * because of this, we have to create a clone of the 
				// *		node, have it point to the same data, but
				// *		have its next value be different
				addNodeFromData( &groupsToUpdate, wireGroup->data, sizeof( struct Wire_Group ) );

				// updating the group's state to the wire's state, 
				//		which is equal to the circuit input's state
				struct Wire_Group group = *( ( struct Wire_Group* ) wireGroup->data );
				group.state = input.state;
				updateWiresToMatchGroupState( group );
			}
		}

		// iterating through the list
		circuitInputNode = circuitInputNode->next;
	}

	// * remember to use removeNodeWithoutDeletion to remove nodes,
	// *	 do NOT use removeNode as it frees the provided node as well

	// * wire update cycle
	struct Node* currentGroupNode = groupsToUpdate;
	while ( currentGroupNode != NULL ) {
		struct Wire_Group currentGroup = *( ( struct Wire_Group* ) currentGroupNode->data );
		// marking group as already updated
		addNodeFromData( &updatedGroups, currentGroupNode->data, sizeof( struct Wire_Group ) );

		// * gate update cycle(s)
		// getting what gates need to be updated
		struct Node* update_nandGate = getElementsUsingWireGroupForInput( currentGroup, TYPE_NAND_GATE );
		struct Node* update_customGate = getElementsUsingWireGroupForInput( currentGroup, TYPE_CUSTOM_GATE );

		// updating the NAND gates
		while ( update_nandGate != NULL ) {
			struct Nand_Gate nand = *( ( struct Nand_Gate* ) update_nandGate->data );
			updateNandGate( &nand );

			// getting all wire groups that are connected to this nand 
			//		gate's output (NAND gates only have 1 output) and 
			//		adding them to the list of wire groups that need
			//		to be updated
			struct Wire* outputWire = getWireFromId( nand.output_id );
			// if the output wire is not set, then we don't do anything
			if ( outputWire == NULL ) {
				update_nandGate = update_nandGate->next;
				continue;
			}

			// getting the wire group that outputWire is in
			struct Node* outputGroupNode = getWireGroupContainingWire( *outputWire );
			// if the output wire's group has not been updated and it 
			//		has not been marked to be updated, then we mark 
			//		it to be updated
			_lambda_arg_wireGroup = *( ( struct Wire_Group* ) outputGroupNode->data );
			if ( searchByLambda( &updatedGroups, _lambda_fxn_findWireGroup ) == false
				&& searchByLambda( &groupsToUpdate, _lambda_fxn_findWireGroup ) == false ) {
				addNodeFromData( &groupsToUpdate, outputGroupNode->data, sizeof( struct Wire_Group ) );
			}

			update_nandGate = update_nandGate->next;
		}

		// updating the custom gates
		while ( update_customGate != NULL ) {
			struct Custom_Gate gate = *( ( struct Custom_Gate* ) update_customGate->data );
			updateCustomGate( &gate );

			// getting all wires that are connected to this gate's outputs
			struct Node* outputWireIdNode = gate.outputs_id;
			while ( outputWireIdNode != NULL ) {
				int* outputWireId = ( int* ) outputWireIdNode->data;
				// if outputWireId == NULL_DEBUG_ID, then we don't need 
				//		to do anything
				if ( outputWireId == NULL ) {
					outputWireIdNode = outputWireIdNode->next;
					continue;
				}

				// getting the output wire
				struct Wire* outputWire = getWireById( *outputWireId );

				// getting the wire group that outputWire is in
				struct Node* outputGroupNode = getWireGroupContainingWire( *outputWire );
				// if the output wire's group has not been updated and 
				//		it has not been marked to be updated, then we
				//		mark it to be updated
				_lambda_arg_wireGroup = *( ( struct Wire_Group* ) outputGroupNode->data );
				if ( searchByLambda( &updatedGroups, _lambda_fxn_findWireGroup ) == false
					&& searchByLambda( &groupsToUpdate, _lambda_fxn_findWireGroup ) == false ) {
					addNodeFromData( &groupsToUpdate, outputGroupNode->data, sizeof( struct Wire_Group ) );
				}

				outputWireIdNode = outputWireIdNode->next;
			}

			update_customGate = update_customGate->next;
		}

		// updating the group's state
		updateWireGroupFromInputs( currentGroup );

		// iterating through the list
		struct Node* temp = currentGroupNode;
		currentGroupNode = currentGroupNode->next;
		removeNodeWithoutDeletion( &currentGroupNode, temp );
	}

	// * Updating all circuit outputs
	struct Node* outputNode = CIRCUIT_OUTPUT_LIST;
	while ( outputNode != NULL ) {
		struct Circuit_Output* output = ( struct Circuit_Output* ) outputNode->data;
		// if the output has no connecting wire, then we do nothing
		if ( output->connectingWire_id == NULL_DEBUG_ID ) {
			outputNode = outputNode->next;
			continue;
		}

		// getting the output's connecting wire
		struct Wire* wire = getWireById( output->connectingWire_id );
		// updating the output's state to its connecting wire's state
		output->state = wire->state;

		// iterating through the list
		outputNode = outputNode->next;
	}
}

/**
 * Gets the provided type of circuit elements that use the provided
 * 		wire group as an input
 *
 * @param group The wire group
 * @param type The type of circuit element to search by
 * @return The circuit elements the wire group is connected to as an
 * 				input
 */
struct Node* getElementsUsingWireGroupForInput( struct Wire_Group group, enum CircuitElementType type ) {
	struct Node* foundElements = NULL;

	// iterating over each wire within the wire group
	struct Node* wireNode = group.wires_id;
	while ( wireNode != NULL ) {
		int wireId = *( ( int* ) wireNode->data );
		struct Wire wire = *getWireFromId( wireId );

		if ( type == TYPE_CIRCUIT_OUTPUT ) {
			// iterating over all the circuit outputs
			struct Node* outputNode = CIRCUIT_OUTPUT_LIST;
			while ( outputNode != NULL ) {
				// if the output node has already been found, we don't want 
				//		to add it again
				if ( searchForData( &foundElements, outputNode->data ) == NULL ) {
					struct Circuit_Output output = *( ( struct Circuit_Output* ) outputNode->data );

					// if the output's connecting wire equals the 
					//		current wire we are working with, then we want 
					//		to add it to the elements found	
					if ( output.connectingWire_id == wire.id ) {
						addNodeFromData( &foundElements, outputNode->data, sizeof( struct Circuit_Output ) );
					}
				}

				// iterating throughout the list
				outputNode = outputNode->next;
			}
		}

		else if ( type == TYPE_NAND_GATE ) {
			// iterating over all the NAND gates
			struct Node* nandNode = NAND_GATE_LIST;
			while ( nandNode != NULL ) {
				// if this NAND gate has already been found, we don't need 
				//		to add it again
				if ( searchForData( &foundElements, nandNode->data ) == NULL ) {
					struct Nand_Gate nand = *( ( struct Nand_Gate* ) nandNode->data );

					// if any of the NAND gate's input wires equal the 
					//		current wire we are working with, then we want
					//		to add this NAND gate to the elements found
					//_lambda_arg_wire = wire;
					_lambda_arg_wireId = wire.id;
					if ( searchByLambda( &nand.inputs_id, _lambda_fxn_findWireById ) ) {
						addNodeFromData( &foundElements, nandNode->data, sizeof( struct Nand_Gate ) );
					}
				}

				// iterating throughout the list
				nandNode = nandNode->next;
			}
		}

		else if ( type == TYPE_CUSTOM_GATE ) {
			struct Node* gateNode = CUSTOM_GATE_LIST;
			while ( gateNode != NULL ) {
				// if this custom gate has already been found, we don't 
				//		need to add it again
				if ( containsNode( &foundElements, gateNode ) == false ) {
					struct Custom_Gate gate = *( ( struct Custom_Gate* ) gateNode->data );

					// if any of the custom gate's input wires equal the 
					//		current wire we are working with, then we 
					//		want to add this custom gate to the 
					//		elements found list
					_lambda_arg_wireId = wire.id;
					if ( searchByLambda( &gate.inputs_id, _lambda_fxn_findWireById ) ) {
						addNodeFromData( &foundElements, gateNode->data, sizeof( struct Custom_Gate ) );
					}
				}

				// iterating throughout the list
				gateNode = gateNode->next;
			}
		}

		wireNode = wireNode->next;
	}

	return foundElements;
}

/**
 * Gets the provided type of circuit elements that use the provided
 * 		wire group as an output
 *
 * @param group The wire group
 * @param type The type of circuit element to search by
 * @return The circuit elements the wire group is connected to as an
 * 				output
 */
struct Node* getElementsUsingWireGroupForOutput( struct Wire_Group group, enum CircuitElementType type ) {
	struct Node* foundElements = NULL;

	// iterating over each wire within the wire group
	struct Node* wireNode = group.wires_id;
	while ( wireNode != NULL ) {
		int wireId = *( ( int* ) wireNode->data );
		struct Wire wire = *getWireFromId( wireId );

		if ( type == TYPE_CIRCUIT_INPUT ) {
			// iterating over all the circuit inputs
			struct Node* inputNode = CIRCUIT_INPUT_LIST;
			while ( inputNode != NULL ) {
				// if the input node has already been found, we don't want 
				//		to add it again
				if ( containsNode( &foundElements, inputNode ) == false ) {
					// if the input's connecting wire equals the 
					//		current wire we are working with, then we want 
					//		to add it to the elements found	
					struct Circuit_Input* input = ( struct Circuit_Input* ) inputNode->data;
					if ( input->connectingWire_id == wire.id ) {
						addNodeFromData( &foundElements, input, sizeof( struct Circuit_Input ) );
					}
				}

				// iterating throughout the list
				inputNode = inputNode->next;
			}
		}

		else if ( type == TYPE_NAND_GATE ) {
			// iterating over all the NAND gates
			struct Node* nandNode = NAND_GATE_LIST;
			while ( nandNode != NULL ) {
				// if this NAND gate has already been found, we don't need 
				//		to add it again
				if ( containsNode( &foundElements, nandNode ) == false ) {
					struct Nand_Gate nand = *( ( struct Nand_Gate* ) nandNode->data );
					struct Wire* outputWire = getWireFromId( nand.output_id );

					// if the NAND gate's output wire equals the current 
					//		wire we are working with, then we want to add 
					//		this NAND gate to the elements found
					if ( compareWireByPosition( *outputWire, wire ) ) {
						addNodeFromData( &foundElements, nandNode->data, sizeof( struct Nand_Gate ) );
					}
				}

				// iterating throughout the list
				nandNode = nandNode->next;
			}
		}

		else if ( type == TYPE_CUSTOM_GATE ) {
			struct Node* gateNode = CUSTOM_GATE_LIST;
			while ( gateNode != NULL ) {
				// if this custom gate has already been found, we don't 
				//		need to add it again
				if ( containsNode( &foundElements, gateNode ) == false ) {
					struct Custom_Gate gate = *( ( struct Custom_Gate* ) gateNode->data );

					// if any of the custom gate's input wires equal the 
					//		current wire we are working with, then we 
					//		want to add this custom gate to the 
					//		elements found list
					_lambda_arg_wireId = wire.id;
					if ( searchByLambda( &gate.outputs_id, _lambda_fxn_findWireById ) ) {
						addNodeFromData( &foundElements, gateNode->data, sizeof( struct Custom_Gate ) );
					}
				}

				// iterating throughout the list
				gateNode = gateNode->next;
			}
		}

		wireNode = wireNode->next;
	}

	return foundElements;
}

