/**
 * Updates the provided wire group based on whatever circuit elements
 * 		use it as their output
 * Theoeretically, every wire group should be connected to only **one**
 * 		circuit element's output
 * If this is not the case, then we will choose the first element from
 * 		the following groups that is not null, in order:
 * 			1. circuit inputs
 * 			2. NAND gates
 * 			3. custom gates
 *
 * @param group the group to update
 */
void updateWireGroupFromInputs( struct Wire_Group group ) {
	// getting the circuit inputs that use the current group as 
	//		their output
	struct Node* node = getElementsUsingWireGroupForOutput( group, TYPE_CIRCUIT_INPUT );
	if ( node != NULL ) {
		// we use the first element from this list of elements
		struct Circuit_Input input = *( ( struct Circuit_Input* ) node->data );
		// updating the wire group's state
		group.state = input.state;

		// updating each individual wire in the wire group
		updateWiresToMatchGroupState( group );
		return;
	}

	// the logic for the below two is similar to that of the above

	// NAND gates
	node = getElementsUsingWireGroupForOutput( group, TYPE_NAND_GATE );
	if ( node != NULL ) {
		struct Nand_Gate nand = *( ( struct Nand_Gate* ) node->data );
		// since NAND gates only store the wire they are connected to 
		//		for their output, we update the group's state to match
		//		that of the NAND gate's output wire
		// if the NAND gate's output wire is null, then we don't do
		//		anything
		if ( nand.output_id != NULL_DEBUG_ID ) {
			struct Wire* outputWire = getWireFromId( nand.output_id );
			group.state = outputWire->state;
		}

		updateWiresToMatchGroupState( group );
		return;
	}

	// custom gates
	node = getElementsUsingWireGroupForOutput( group, TYPE_CUSTOM_GATE );
	if ( node != NULL ) {
		struct Custom_Gate gate = *( ( struct Custom_Gate* ) node->data );
		// iterating through each output wire ID
		struct Node* outputWireIdNode = gate.outputs_id;
		while ( outputWireIdNode != NULL ) {
			int outputWireId = *( ( int* ) outputWireIdNode->data );
			struct Wire* outputWire = getWireById( outputWireId );

			// getting the wire group that contains the current output wire
			struct Node* node = getWireGroupContainingWire( *outputWire );
			struct Wire_Group foundGroup = *( ( struct Wire_Group* ) node->data );
			if ( group.id == foundGroup.id ) {
				group.state = outputWire->state;
			}

			outputWireIdNode = outputWireIdNode->next;
		}
		//// TODO fix later
		//// TODO needs to use the wire IDs now, since gate.outputs_id is new
		//struct Custom_Gate gate = *( ( struct Custom_Gate* ) node );
		//// custom gates can connect to up to three output wires, but
		////		the states of all these wires should be the same
		//// therefore we just use the first one to update this group's
		////		state
		//struct Wire gateFirstOutputWire = *( ( struct Wire* ) gate.outputs->data );
		//group.state = gateFirstOutputWire.state;

		updateWiresToMatchGroupState( group );
		return;
	}

	// if none of the above are true, set the state to false (off)
	group.state = false;
	updateWiresToMatchGroupState( group );
}

/**
 * Updates each individual wire's state within the provided group to
 * 		match the state the group is at
 *
 * @param group The group to update
 */
void updateWiresToMatchGroupState( struct Wire_Group group ) {
	struct Node* wireNode = group.wires_id;
	while ( wireNode != NULL ) {
		int wireId = *( ( int* ) wireNode->data );
		struct Wire* wire = getWireFromId( wireId );
		wire->state = group.state;
		wireNode = wireNode->next;
	}
}

/**
 * Updates each individual wire's state within the provided group to
 * 		match the state the group is at
 * Updates the provided wire's group's state to match that wire's state
 * In doing this, all wires that are within the wire's group are updated
 *		to match the provided wire's state as well
 *
 * @param wire The wire to update
 */
void forceUpdateWireGroupStateFromWire( struct Wire wire ) {
	_lambda_arg_wire = wire;
	struct Node* node = searchByLambda( &WIRE_GROUP_LIST, _lambda_fxn_getWireGroupContainingWire );
	if ( node == NULL ) { return; }

	struct Wire_Group* group = ( struct Wire_Group* ) node->data;
	group->state = wire.state;
	updateWiresToMatchGroupState( *group );
}

/**
 * Adds the provided wire to any circuit element's inputs/outputs,
 *		depending on the wire's position relative to that element
 *
 * @param wire The wire to perform hitbox detection on
 */
void hitboxDetectionForWire( struct Wire* wire ) {
	// Iterating through the NAND gates
	struct Node* nandNode = NAND_GATE_LIST;
	while ( nandNode != NULL ) {
		struct Nand_Gate* nand = ( struct Nand_Gate* ) nandNode->data;
		struct Position pos = nand->position;
		struct Wire* outputWire = getWireFromId( nand->output_id );

		// Checking if the wire needs to be the NAND 
		//		gate's output
		// If the NAND gate's output is already set, then we don't 
		//		need to do anything
		if ( outputWire == NULL || compareWireStrictly( *outputWire, MACRO_NULL_WIRE ) ) {
			struct Position outputPos = sumPositions( pos, NAND_OUTPUT_VECTOR );

			// If the wire is within the buffer range of the NAND 
			//		gate's output, then we set the NAND's output
			//		wire to be this wire
			if ( wireInRangeOfPosition( *wire, outputPos, WIRE_CONNECTION_BUFFER_RANGE ) ) {
				nand->output_id = wire->id;
			}
		}

		// if the NAND gate already has two inputs, then we don't
		//		need to do anything
		if ( getListSize( &nand->inputs_id ) >= 2 ) {
			nandNode = nandNode->next;
			continue;
		}

		// Checking if the wire needs to be part of the NAND 
		//		gate's upper input
		struct Position upperInputPos = sumPositions( pos, NAND_INPUT_ONE_VECTOR );
		if ( wireInRangeOfPosition( *wire, upperInputPos, WIRE_CONNECTION_BUFFER_RANGE ) ) {
			// Adding the wire to the NAND gate's input list
			addNodeFromData( &nand->inputs_id, &wire->id, sizeof( int ) );
		}

		// If the NAND gate now has two or more inputs, then we 
		//		don't need to do anything else
		if ( getListSize( &nand->inputs_id ) >= 2 ) {
			nandNode = nandNode->next;
			continue;
		}

		// Checking if the wire needs to be part of the NAND 
		//		gate's lower input
		struct Position lowerInputPos = sumPositions( pos, NAND_INPUT_TWO_VECTOR );
		if ( wireInRangeOfPosition( *wire, lowerInputPos, WIRE_CONNECTION_BUFFER_RANGE ) ) {
			// Adding the wire to the NAND gate's input list
			addNodeFromData( &nand->inputs_id, &wire->id, sizeof( int ) );
		}

		nandNode = nandNode->next;
	}

	// Iterating through custom gates
	struct Node* gateNode = CUSTOM_GATE_LIST;
	while ( gateNode != NULL ) {
		struct Custom_Gate* gate = ( struct Custom_Gate* ) gateNode->data;

		// Performing hitbox detection for the gate's inputs and outputs
		hitboxDetectionForWire_customGateInput( wire, gate );
		hitboxDetectionForWire_customGateOutput( wire, gate );

		gateNode = gateNode->next;
	}

	// Iterating through the circuit inputs
	struct Node* inputNode = CIRCUIT_INPUT_LIST;
	while ( inputNode != NULL ) {
		struct Circuit_Input* input = ( struct Circuit_Input* ) inputNode->data;
		struct Position pos = input->pos;

		// If the input's output wire is already set, then we 
		//		don't need to do anything else
		if ( input->connectingWire_id != NULL_DEBUG_ID ) {
			inputNode = inputNode->next;
			continue;
		}

		// Checking if the wire needs to be set as this 
		//		input's connecting wire
		struct Position portPosition = sumPositions( pos, CIRCUIT_INPUT_VECTOR );
		if ( wireInRangeOfPosition( *wire, portPosition, WIRE_CONNECTION_BUFFER_RANGE ) ) {
			// Setting the wire as the input's connecting wire
			input->connectingWire_id = wire->id;
		}

		inputNode = inputNode->next;
	}

	// Iterating through the circuit outputs
	struct Node* outputNode = CIRCUIT_OUTPUT_LIST;
	while ( outputNode != NULL ) {
		struct Circuit_Output* output = ( struct Circuit_Output* ) outputNode->data;
		struct Position pos = output->pos;

		// If the output's connecting wire is already set, then we 
		//		don't need to do anything else
		if ( output->connectingWire_id != NULL_DEBUG_ID ) {
			outputNode = outputNode->next;
			continue;
		}

		// Checking if the wire needs to be set as this output's 
		//		connecting wire
		struct Position portPosition = sumPositions( pos, CIRCUIT_OUTPUT_VECTOR );
		if ( wireInRangeOfPosition( *wire, portPosition, WIRE_CONNECTION_BUFFER_RANGE ) ) {
			// Setting the wire as the output's connecting wire
			output->connectingWire_id = wire->id;
		}

		outputNode = outputNode->next;
	}
}

/**
 * Performs hitbox detection for the provided wire on the provided
 * 		custom gate's inputs
 *
 * @param wire The wire
 * @param gate The custom gate
 */
void hitboxDetectionForWire_customGateInput( struct Wire* wire, struct Custom_Gate* gate ) {
	struct Position pos = gate->position;

	// Checking if the wire needs to be part of any of gate's inputs
	for ( int k = 0; k < 3; k++ ) {
		// if the gate already has three inputs, then we don't need to do 
		//		anything else
		if ( getListSize( &gate->inputs_id ) >= 3 ) { return; }

		// Getting the position of the current port we are working with
		struct Position deltaVector = CUSTOM_INPUT_DELTA_VECTOR;
		deltaVector.x *= k;
		deltaVector.y *= k;
		struct Position sumVector = sumPositions( deltaVector, CUSTOM_INPUT_INIT_VECTOR );
		struct Position portPos = sumPositions( pos, sumVector );

		// Checking if the wire is in range of the port
		if ( wireInRangeOfPosition( *wire, portPos, WIRE_CONNECTION_BUFFER_RANGE ) ) {
			// Adding the wire to the gate's input list
			if (!searchForData(&gate->inputs_id, &wire->id)){
			addNodeFromData( &gate->inputs_id, &wire->id, sizeof( int ) );
			}
		}
	}
}

/**
 * Performs hitbox detection for the provided wire on the provided
 * 		custom gate's outputs
 *
 * @param wire The wire
 * @param gate The custom gate
 */
void hitboxDetectionForWire_customGateOutput( struct Wire* wire, struct Custom_Gate* gate ) {
	struct Position pos = gate->position;

	// Checking if the wire needs to be part of any of gate's outputs
	for ( int k = 0; k < 3; k++ ) {
		// if the gate already has three outputs, then we don't need to do 
		//		anything else
		if ( getListSize( &gate->outputs_id ) >= 3 ) { return; }

		// Getting the position of the current port we are working with
		struct Position deltaVector = CUSTOM_OUTPUT_DELTA_VECTOR;
		deltaVector.x *= k;
		deltaVector.y *= k;
		struct Position sumVector = sumPositions( deltaVector, CUSTOM_OUTPUT_INIT_VECTOR );
		struct Position portPos = sumPositions( pos, sumVector );

		// Checking if the wire is in range of the port
		if ( wireInRangeOfPosition( *wire, portPos, WIRE_CONNECTION_BUFFER_RANGE ) ) {
			// Adding the wire to the gate's input list
			if (!searchForData(&gate->outputs_id, &wire->id)){
			addNodeFromData( &gate->outputs_id, &wire->id, sizeof( int ) );
			}
		}
	}
}

/**
 * Saves the current circuit into a custom gate
 *
 * @param customGateIdentifier The custom gate identifier to store the
 * 									current circuit into
 */
void saveCurrentCircuitIntoCustomGate( char customGateIdentifier ) {
	struct Custom_Gate gate = MACRO_NULL_CUSTOM_GATE;
	gate.id = generateDebugId();
	gate.name = customGateIdentifier;
	
	struct Node* node = SAVED_CUSTOM_GATE_LIST;
	while ( node != NULL ) {
		struct Custom_Gate g = *( ( struct Custom_Gate* ) node->data );
		if ( g.name == customGateIdentifier ) {
			removeNode( &SAVED_CUSTOM_GATE_LIST, node );
			break;
		}
		node = node->next;
	}

	// * Setting the circuit inputs to the different possible 
	// *	combinations they can have
	for ( int i = 0; i < 8; i++ ) {
		int counter = 0;
		struct Node* inputNode = CIRCUIT_INPUT_LIST;
		while ( inputNode != NULL && counter < 3 ) {
			struct Circuit_Input* input = ( struct Circuit_Input* ) inputNode->data;
			input->state = POTENTIAL_INPUTS[i][counter];

			counter++;
			inputNode = inputNode->next;
		}

		// * Simulating this combination of circuit inputs and getting 
		// *	the circuit outputs
		// Simulating the circuit
		updateEverything();

		// Getting the circuit outputs and saving them to the custom 
		//		gate's truth table
		counter = 0;
		struct Node* outputNode = CIRCUIT_OUTPUT_LIST;
		while ( outputNode != NULL && counter < 3 ) {
			struct Circuit_Output* output = ( struct Circuit_Output* ) outputNode->data;
			gate.truth_table[i][counter] = output->state;

			counter++;
			outputNode = outputNode->next;
		}
	}

	// * Saving the custom gate to the list of saved custom gates

	
	
	if (gate.inputs_id != NULL) clearList(&gate.inputs_id);
	if (gate.outputs_id != NULL) clearList(&gate.outputs_id);

	
	addNodeFromData( &SAVED_CUSTOM_GATE_LIST, &gate, sizeof( struct Custom_Gate ) );	
}

/**
 * Clears all circuit element lists
 */
void clearCircuit() {
	// Removing all wire groups
	clearList( &WIRE_GROUP_LIST );

	// Removing all wires
	clearList( &WIRE_LIST );

	// Removing all NAND gates
	clearList( &NAND_GATE_LIST );

	// Removing all custom gates
	clearList( &CUSTOM_GATE_LIST );

	// Resetting the states and connected wires of the circuit inputs
	struct Node* inputNode = CIRCUIT_INPUT_LIST;
	while ( inputNode != NULL ) {
		struct Circuit_Input* input = ( struct Circuit_Input* ) inputNode->data;
		input->connectingWire_id = NULL_DEBUG_ID;
		input->state = false;

		inputNode = inputNode->next;
	}

	// Resetting the states and connected wires of the circuit outputs
	struct Node* outputNode = CIRCUIT_OUTPUT_LIST;
	while ( outputNode != NULL ) {
		struct Circuit_Output* output = ( struct Circuit_Output* ) outputNode->data;
		output->connectingWire_id = NULL_DEBUG_ID;
		output->state = false;

		outputNode = outputNode->next;
	}
}

/**
 * Draws a cleared version of the circuit to the screen
 */
void drawClearedCircuit() {
	// Iterating over all the wires
	struct Node* wireNode = WIRE_LIST;
	while ( wireNode != NULL ) {
		struct Wire* wire = ( struct Wire* ) wireNode->data;
		delete_wire( *wire );

		wireNode = wireNode->next;
	}

	// Iterating over all the NAND gates
	struct Node* nandNode = NAND_GATE_LIST;
	while ( nandNode != NULL ) {
		struct Nand_Gate* nand = ( struct Nand_Gate* ) nandNode->data;
		deleteNandGate( *nand );

		nandNode = nandNode->next;
	}

	// Iterating over all the custom gates
	struct Node* gateNode = CUSTOM_GATE_LIST;
	while ( gateNode != NULL ) {
		struct Custom_Gate* gate = ( struct Custom_Gate* ) gateNode->data;
		deleteCustomGate( *gate );

		gateNode = gateNode->next;
	}

	// Iterating over all the circuit inputs
	struct Node* inputNode = CIRCUIT_INPUT_LIST;
	while ( inputNode != NULL ) {
		struct Circuit_Input* input = ( struct Circuit_Input* ) inputNode->data;
		drawCircuitInputFalse( *input );

		inputNode = inputNode->next;
	}

	// Iterating over all the circuit outputs
	struct Node* outputNode = CIRCUIT_OUTPUT_LIST;
	while ( outputNode != NULL ) {
		struct Circuit_Output* output = ( struct Circuit_Output* ) outputNode->data;
		drawCircuitOutput( *output );

		outputNode = outputNode->next;
	}
}

/**
 * Fetches a wire with the provided ID from WIRE_LIST
 *
 * @param id The ID of the wire to get
 * @return the address of the wire, if found.
 *				Returns NULL if not found
 */
struct Wire* getWireFromId( int id ) {
	struct Node* node = WIRE_LIST;
	while ( node != NULL ) {
		struct Wire* wire = ( struct Wire* ) node->data;
		if ( wire->id == id ) return wire;
		node = node->next;
	}

	return NULL;
}

