/**
 * Compares two wires by their positions (not their states)
 *
 * @param wire1 The first wire
 * @param wire2 The second wire
 * @return true if the wires are equal
 * @return false if the wires are not equal
 */
bool compareWireByPosition( struct Wire wire1, struct Wire wire2 ) {
	return comparePosition( wire1.startPos, wire2.startPos ) && comparePosition( wire1.endPos, wire2.endPos );
}

/**
 * Compares two wires strictly
 *
 * @param wire1 The first wire
 * @param wire2 The second wire
 * @return true if the wires are equal
 * @return false if the wires are not equal
 */
bool compareWireStrictly( struct Wire wire1, struct Wire wire2 ) {
	return wire1.id == wire2.id && compareWireByPosition( wire1, wire2 ) && wire1.state == wire2.state;
}

/**
 * Checks if a wire is within a certain range of a
 *		position
 *
 * @param wire The wire
 * @param pos The position
 * @param range The range (inclusive)
 * @return true if the wire is within the position
 * @return false otherwise
 */
bool wireInRangeOfPosition( struct Wire wire, struct Position pos, int range ) {
	double rangeSquared = range * range;
	return calculateDistanceSquared( wire.startPos, pos ) <= rangeSquared
		|| calculateDistanceSquared( wire.endPos, pos ) <= rangeSquared;
}

/**
 * Compares two positions
 *
 * @param pos1 The first position
 * @param pos2 The second position
 * @return true if the positions are equal
 * @return false if the positions are not equal
 */
bool comparePosition( struct Position pos1, struct Position pos2 ) {
	return pos1.x == pos2.x && pos1.y == pos2.y && pos1.direction == pos2.direction;
}

/**
 * Returns the sum of the two positions
 *
 * @param pos1 The first position
 * @param pos2 The second position
 * @return the sum of the two positions
 */
struct Position sumPositions( struct Position pos1, struct Position pos2 ) {
	struct Position pos;
	pos.x = pos1.x + pos2.x;
	pos.y = pos1.y + pos2.y;
	return pos;
}

/**
 * Handles cursor movement
 * * Note: this does NOT draw the cursor to the screen anymore
 * * It only changes the position of the cursor, no more
 *
 * @param pos The cursor's current position
 * @param prev_pos The cursor's previous position
 * @param action The action the user wants to do with the cursor
 */
void handleCursorMovement( struct Position* pos, struct Position* prev_pos, enum Keybindings action ) {
	if ( action == MOVE_UP && pos->y > 3 ) { // up
		prev_pos->x = pos->x;
		prev_pos->y = pos->y;
		pos->y = pos->y - 4;
	}
	else if ( action == MOVE_LEFT && pos->x > 3 ) { // left
		prev_pos->x = pos->x;
		prev_pos->y = pos->y;
		pos->x = pos->x - 4;
	}
	else if ( action == MOVE_DOWN && pos->y < 236 ) { // down
		prev_pos->x = pos->x;
		prev_pos->y = pos->y;
		pos->y = pos->y + 4;
	}
	else if ( action == MOVE_RIGHT && pos->x < 315 ) { // right
		prev_pos->x = pos->x;
		prev_pos->y = pos->y;
		pos->x = pos->x + 4;
	}
}

/**
 * Only used for extracting the keyboard data to get out of the
 * 		start screen
 * * Should NOT be used anywhere else
 */
char input[3] = { 0, 0, 0 }; // ? might want to be an int
enum KeyboardValue extractKeyboardData() {
	volatile int* pointer = ( int* ) 0xFF200100;
	int ps2Data, rvalid;

	const int breakCode = 0xF0;
	while ( 1 == 1 ) {
		ps2Data = *pointer;
		rvalid = ps2Data & 0x8000;
		if ( rvalid ) {
			input[0] = input[1];
			input[1] = input[2];
			input[2] = ps2Data & 0xFF;

			HEX_PS2( input[0], input[1], input[2] );
			if ( input[1] == breakCode ) continue; // do nothing
			return input[2];
		}
	}

	return input[2];
}

